import React, { useState } from "react";

//Componentes
import BtnPrimary from "../components/btn_primary";

//Navegacion
import { useNavigate } from "react-router-dom";

//BACK
import Axios from "axios";
import axios from "axios";

function Home() {

    const [infoCard, setInfoCard] = useState([])
    //Navegacion
    const navigate = useNavigate();

    //Card
    const card = () => {
        Axios.get(`http://localhost:8891/api/getCard`).then((response)=>{
            setInfoCard(response.data)
        })
    }

    //Funcion de navegacion
    const login = () =>{
        navigate("/")
    }

    return (
        <div className="home">
            <h2>Entramos</h2>
            {infoCard.map((e) => (
                <div>
                    <h4>{e.titul}</h4>
                    <h4>{e.informacion}</h4>
                    <h4>{e.image}</h4>
                    <h4>{e.fecha}</h4>
                    <h4>{e.fuente}</h4>
                    <h4>{e.id}</h4>

                </div>
            ))}
            <BtnPrimary funcion={card} name={"Mostrar Card"}/>
            <BtnPrimary funcion={login} name={"Cerrar Sesion"}/>
        </div>
    )
}

export default Home
